import React from 'react'
import { LazyLoadImage } from 'react-lazy-load-image-component';
import Typical from 'react-typical'

export default function Header() {
	const style = {
		backgroundColor: "#0c2461"
	}
	return (
		<div className="min-h-screen flex items-center justify-center" style={style}>
			<div className="flex flex-col items-center justify-center md:flex-row-reverse md:w-10/12 justify-between">
				<div className="w-full md:w-4/5">
					<LazyLoadImage
						src="https://avatars2.githubusercontent.com/u/57114259?s=460&u=396e80032f6c36d670ff6506a44a42604ae137a3&v=4"
						effect="blur"
						placeholderSrc={process.env.PUBLIC_URL + '/logo512.png'}
					/>
				</div>
				<div className="text-white text-center md:text-left">
					<h2 className="text-4xl font-bold font-dosis md:text-left">Hi <br/> I'm full stack JS developer</h2>
					<br />
					<h1>
						<Typical
							steps={['I\'m backend developer.', 1000, 'I\'m frontend developer.', 1000, 'I\'m fullstack developer in short.', 1000]}
							loop={Infinity}
							className="font-dosis font-bold text-2xl text-gray-500 " />
					</h1>
					<button className="bg-indigo-500 px-10 py-3 rounded-lg text-xl uppercase mt-10 font-bold outline-none animate-float"> Discover more</button>
				</div>
			</div>
		</div>
	)
}
